import React from 'react'


export default class Radiobuttons extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            checked: 'false'
        }
    }

  

    render() {
        return (
            <div>
                
                {<input type="radio" onChange={this.props.onChange} />}
                <label>First</label>
                {<input type="radio" onChange={this.props.onChange} />}
                <label>Second</label>
                {<input type="radio" onChange={this.props.onChange} />}
                <label>Third</label>
            </div>
        )
    }
}
